INSERT INTO `products` VALUES (15,'Shiseido Lip Balm','ဆောင်းရာသီတင်မက နှုတ်ခမ်းခြောက်ပြီးကွဲတတ်လို့စိတ်ညစ်နေတဲ့သူလေးတွေရှိလား \n‌နှုတ်ခမ်းလေးလည်း ကျန်းမာနေမှဖြစ်မှာပါနော် \nနှုတ်ခမ်းသားလေးနူးညံ့ပြီး စိုစိုအိအိလေးဖြစ်စေဖို့ \nLip balm ကောင်းကောင်းလေးသုံးချင်ရင်တော့ Shiseido Water In Lip လေးကိုသုံးကြည့်လိုက်ပါ',13000.00,3,'SKINCARE',16,'2025-03-12 05:23:04','2025-03-17 06:11:33',1),(16,'Naturie Skin Conditioner','Naturie Skin Conditioner\nJapan နိုင်ငံရဲ့ best seller skin care လေးနဲ့မိတ်ဆက်ပေးပါရစေ\nဒီ Toner လေးက hatomugi လို့ခေါ်တဲ့ မုယောစပါးအပင်ကအစေ့နဲ့ သဘာ၀ ingredients တွေပေါင်းစပ်ပြီးထုတ်လုပ်ထားတာမို့ ‌အသားအရည်ကိုရေဓါတ်ဖြည့်ပေးတယ် ၊အသားအရည် ချောမွေ့စေတယ် \nအနံ့လည်းမရှိသလို စေးကပ်ကပ်ကြီးလည်းဖြစ်မနေဘူး\nအသုံးပြုနိုင်တဲ့နည်းလမ်းတွေကတော့\n(၁) တိုနာရည်ကို Cottonpad နဲ့တွဲသုံးတာ✅\n(၂) Spray ဖြန်းလို့ရတဲ့ ဗူးထဲထည့်ပြီး mist အနေနဲ့အသုံးပြုတာ✅\n(၃) dry sheet mask နဲ့တွဲသုံးတာ ✅\nကိုယ်တိုင်သုံးကြည့်ပြီးရတာတဲ့ result များ\n*နံပါတ်သုံးနည်းလမ်းကတော့ effective အဖြစ်ဆုံးနဲ့အကြိုက်ဆုံးပါ\n-မျက်နှာကရေဓါတ်ပြည့်ပြီး ကြည်လာတယ်\n-အဆီပြန်တာလျှော့ကျပြီး အဆီဖုထွက်တာသက်သာလာတယ်\n500ml တောင်ပါတာမို့ မျက်နှာတင်မက body တွေပါ အသုံးပြုလို့ရပါတယ်နော် \n100% Authentic ပါရှင့်',50000.00,10,'SKINCARE',NULL,'2025-03-12 05:30:28','2025-03-12 05:30:28',1),(17,'Lululun Face mask','ဒါလေးကတော့ Japan နိုင်ငံမှာ No.1 Top Brand Daily mask လေးပါနော်\nရွေးချယ်စရာသုံးမျိုး ရှိပါတယ်\nDeep Moisturizing (Blue) ?\nMoisturizing & Hydrating ( Pink ) ?\nWhitening (White) ?\nSame Base ingredients ကတော့ Collagen ,Hyaluronic acid ပါဝင်ပီး anti -aging  အတွက် အထောက်အကူ ဖြစ်စေပါတယ် \nColour လေးတွေရဲ့ထူးခြားမှုကတော့ \n? Pink လေးမှာတော့ royal jelly, rice ceramide & aloe vera extract ပါဝင်ပြီးအသားအရေ ခြောက်သွေ့မှု မဖြစ်အောင် ကာကွယ်ပေးပြီး moisture ဓါတ်ကို ထိန်းပေးပြီး \naloe Vera ကအသားအရေ ကို နူးညံ ချောမွေ့ စေမှာပါ\n? Blue colour လေးကတော့ Pink မှာပါတာလေးအပြင် aloe Vera အစား citrus andseaweed extracts ပါဝင်လို့ dead cells တွေကိုလျော့ပေးပြီး Healthy skin ဖြစ်အောင် ကူညီပေးပါတယ် ။ \nDEEP MOISTURIZING ဆိုတဲ့ အတိုင်း လုံးဝ မျက်နှာ